import React, { Component } from 'react';
import Message from './Message.js'

class MessageList extends Component {
  state = {
    messages: this.props.messages
  }
  render() {
    return (
      <div className="container">
        <div className="row">
          {(this.state.messages) ? this.state.messages.map((message, i) => {return <Message starMessage={this.props.starMessage} key={i} id={this.state.messages[i].id} subject={this.state.messages[i].subject} read={this.state.messages[i].read} starred={this.state.messages[i].starred} labels={this.state.messages[i].labels}/>}) : console.log(this.state)}
        </div>
      </div>
    )
  }

}
export default MessageList;
